import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router,Route,Link} from 'react-router-dom';
import RestorantCreate from './components/RestorantCreate';
import RestorantUpdate from './components/RestorantUpdate';
import RestorantDelete from './components/RestorantDelete';
import RestorantDetail from './components/RestorantDetail';
import RestorantList from './components/RestorantList';
import RestorantSearch from './components/RestorantSearch';
import Home from './components/Home';

function App() {
  return (
    <div className="App">
      <Router>
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/create">Create</Link></li>
          <li><Link to="/update">Update</Link></li>
          <li><Link to="/delete">Delete</Link></li>
          <li><Link to="/search">Search</Link></li>
          <li><Link to="/list">List</Link></li>
          <li><Link to="/detail">Detail</Link></li>
        </ul>        
        <Route exact path='/'>
          <Home />
        </Route>
        <Route path='/create'>
          <RestorantCreate />
        </Route>
        <Route path='/update'>
          <RestorantUpdate />
        </Route>
        <Route path='/list'>
          <RestorantList />
        </Route>
        <Route path='/detail'>
          <RestorantDetail />
        </Route>
        <Route path='/search'>
          <RestorantSearch />
        </Route>
        <Route path='/delete'>
          <RestorantDelete />
        </Route>
      </Router>
    </div>
  );
}

export default App;
